import React from 'react'
import { useLocation } from "react-router-dom";

function ResultScreen() {

  let params = useLocation();

  let result = params.state.message;

  return (
    <div>
      <header className="App-header">
        نتيجة دراسة الجدوى
      </header>

      <p>
        {result}
      </p>

    </div>
  )
}

export default ResultScreen
